// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./UserRegistration.sol";

contract RentalAgreement {

    // The rental transation itself
    struct Rental {
        address renterAddress;  // Address of the renter
        uint256 startDate;      // Start time of the rental agreement (timestamp)
        uint256 endDate;
        uint256 rentalFee;      // Fee for the rental agreement
        bool isActive;          //true when the rental agreement is initiated and set to false when the bicycle is returned
    }

    mapping(uint256 => Rental) public rentals;
    uint256  public rentalId; // = 1;

    address public admin;       // Admin account that creates and signs contracts
    UserRegistration public renter;
    // mapping(address => UserRegistration.Renter) public renters;

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can call this function");
        _;
    }

    function isUserRegistered(address _renter) public view returns (bool){
        (, , ,bool isRegistered) = renter.getRenterDetails(_renter);
        return isRegistered;
    }

    constructor(address _userRegistry) {
        admin = msg.sender;
        renter = UserRegistration(_userRegistry);
        // Renter storage renterInfo = renters[msg.sender];
        /*renterInfo.walletAddress = msg.sender;
        renterInfo.name = "";
        renterInfo.canRent = true;
        renterInfo.balance = 0;
        renterInfo.isRegistered = true;*/
        /*renter.walletAddress = msg.sender;
        renter.name = "";
        renter.canRent = true;
        renter.balance = 0;
        renter.isRegistered = true;*/
    }

    // check out bike
    function  checkoutBike() public returns (bool){ //uint256 _startDate, uint256 _endDate
        rentalId++;
        require(isUserRegistered(msg.sender), "User is not registered");
        // Fetch renter details
        (, bool canRent, , ) = renter.getRenterDetails(msg.sender);
        require(canRent, "Renter is not eligible to rent");

        /* Renter storage renter = renters[msg.sender];
        rentals[rentalId].renterAddress= msg.sender;
        rentals[rentalId].startDate = _startDate;
        rentals[rentalId].endDate   = _endDate;*/
        //return isValidDates(_startDate,_endDate);
        return true;
    }

    // check in a bike

    // Get total duration of a bike use/trip
    function getDuration(uint256 _startDate, uint256 _endDate) internal pure returns(uint){
        return (_endDate - _startDate)/3600;   // Duration is returned in hours
    }

    // Get  the cost of a specific trip (based on dates)


    /* address public admin; // address payable owner;
    constructor() {
        admin = msg.sender;
    }

    modifier onlyAdmin(){
        require(msg.sender == admin, "Only admin can call this function");
        _;
    }*/
    
    event NewRental(address indexed rentee, uint256 indexed rentalId);

    /**
     * @dev Adds a new rental to the list of active rentals.
     */
    //function addNewRental(address rentee, uint256 start, uint256 end, uint256 fee) external onlyAdmin{
    //    rentalId++;
        /*Rental storage newRental = rentals[rentalId];
        newRental.renterAddress = rentee;
        newRental.startDate = start;
        newRental.endDate = end;
        newRental.rentalFee = fee;
        
        emit NewRental(rentee, rentalId);*/
    //}

    /**
     * @dev Returns information about a specific rental.
     */
    function getRentalInfo(uint256 _id) view external returns(
        address rentee,
        uint256 startDate,
        uint256 endDate,
        bool isActive
    ) {
        Rental memory rental = rentals[_id];
        isActive = (block.timestamp <= rental.endDate) ? true : false;
        return (rental.renterAddress, rental.startDate, rental.endDate, isActive);
    }

    //mapping(uint256 => Rental) private rentals;   // St ores the details of each rental transaction in the marketplace
    //mapping(uint256 => Rental) private rentals; // Mapping from token ID to rental data
    //uint256 public rentalId=0;   // Counter for rental IDs
}
